Parabéns ao botafogo, campeão Mundial de seleção 😂😂😂😂
Isso é lenda urbana. É só fazer uma pesquisa simples que vai ver que em nenhum mundial vencido pelo Brasil o botafogo tinha a maioria dos jogadores. Em 58, a base foi o Flamengo (4 jogadores), Vasco, santos e botafogo tinham 3, na final tinham 3 do vasco; em 62, foram 6 do Santos e 4 do botafogo; em 70, 5 do Santos e 3 do botafogo. Já que esses jogadores eram tão bons assim "e ganharam as copas para o Brasil", porque o botafogo então não foi multicampeão com esses jogadores? Nessa época (nem nunca), o botafogo não teve supremacia nem no Rio de Janeiro.

